import React from 'react'

import PageTitle from '../components/Typography/PageTitle'
import Expenses from '../components/Insights/Expenses'
import Cashflow from '../components/Insights/Cashflow'
import Balance from '../components/Insights/Balance'
import Categories from '../components/Categories'
import Server from '../utils/server'

import { EditIcon, MenuIcon } from '../icons'
import {
  TableBody,
  TableContainer,
  Table,
  TableHeader,
  TableCell,
  TableRow,
  TableFooter,
  Button,
  Pagination,
} from '@windmill/react-ui'
import response from '../utils/demo/categoryData'

export default class Insights extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      categories: []
    }
  }
  componentDidMount() {
    Server.categories().then(categories => {
      this.setState({categories: categories})
    })
  }

  render() {
    return (
      <>
        <PageTitle>Insights</PageTitle>
        <div className="grid gap-6 mb-8 md:grid-cols-2">
          <Categories categories={this.state.categories} />
          <Expenses />
          <Cashflow />
          <Balance />
        </div>
      </>
    );
  }
}
